        if (id === "navbar1") {
            let navbar = document.getElementById("navbar1");
            navbar.id = "navbarState1";
        } else {
            let navbar = document.getElementById("navbarState1");
            navbar.id = "navbar1";
        }
        console.log(id);
    }, [id] );
    const newId = ()=> {
        if (id === "navbarState1") {
            return "navbar1";
        } else {
            return "navbarState1";
        }
    };
    return (
        <nav id={id}>
                <Link to="/" className="title"><h1>College Kitchen</h1></Link>              
                <Link to="/About">About</Link>              
                <Link to="/">Menu</Link>
                <div onClick={() => setId(newId())}> </div>
        </nav>
    );
}

